          name="Beyonce"
          img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
          tel="+123 456 789"
          mail="b@beyonce.com"
      />
    </div>
  );
}

export default App;
